-- Crear una tabla temporal para almacenar los detalles de las URLs e IDs
CREATE TEMP TABLE trackers_sources_cau2_v2 (id text, url text);

-- Insertar los detalles de las solicitudes en la tabla
-- Eliminar los registros antiguos de la tabla objetivo
DELETE FROM trackers_cau2fv WHERE date >= now() - interval '2 days';

DO $$ 
DECLARE
    startdate text := to_char(current_date - 2, 'YYYYMMDD');
BEGIN
    FOR rec IN SELECT * FROM trackers_sources_cau2_v2 LOOP
        -- Crear tablas temporales
        DROP TABLE IF EXISTS stage_trackers_cau2_v2;
        DROP TABLE IF EXISTS stage_trackers_cau22_v2;
        CREATE TEMP TABLE stage_trackers_cau2_v2(x jsonb);
        CREATE TEMP TABLE stage_trackers_cau22_v2(date timestamptz, val numeric(10,4), id text, cau text);

        -- Descargar y copiar los datos usando curl
        EXECUTE format(
            'COPY stage_trackers_cau2_v2 FROM PROGRAM ''curl -H "Api-Key:38deaa51-8716-4cc9-aa42-ab14fb72a752.01" "%s?&start_date=%sT000000Z"''',
            rec.url, startdate
        );

        -- Insertar los datos en la tabla temporal
        SELECT f.* 
        FROM stage_trackers_cau2_v2, jsonb_populate_recordset(null::stage_trackers_cau22_v2, x) f;

        -- Actualizar los valores de ID, cau y truncar la fecha a minutos
        UPDATE stage_trackers_cau22_v2 
        SET id = rec.id, 
            cau = 'cau2fv', 
            date = DATE_TRUNC('minute', date);

        -- Insertar los datos finales en la tabla objetivo
        SELECT * 
        FROM stage_trackers_cau22_v2 
        ON CONFLICT DO NOTHING;
    END LOOP;
END $$;

-- Limpiar la tabla temporal de fuentes
DROP TABLE trackers_sources_cau2_v2;
